import React from 'react';
import './Footer.css';
import img from '../../../src/TOS.jpg'

const Footer = () => {
    return ( 
        <footer className="footer">
            <div className='container'>
                <div className='row'>
                    <image src={img} alt="Dwyer"/> 
                </div>
            </div>
            <image src={img} alt="Dwyer"/>

        </footer>
     );
}

export default Footer;
